    if (len (narray) <= 1):
        return narray

    if (len (narray) == 2):
        
        if (narray[0] > narray[1]):
            (narray[0], narray[1]) = (narray[1], narray[0])

            return narray

    middle = len(narray)/2
    array1 = merge_sort( narray[0: middle])
    array2 = merge_sort( narray[middle: len(narray)])

    sorted_array = []
    
    while( array1 or array2 ):
        if ( not array2 ):
            sorted_array.append( array1.pop(0))
            
        elif ( not array1 ):
            sorted_array.append( array2.pop(0))
        
        elif ( array1[0] < array2[0]):
            sorted_array.append( array1.pop(0))
        else:
            sorted_array.append( array2.pop(0))

    return sorted_array



